import React, { Component } from 'react';
import './App.css';

class App extends Component {

  render() {
    return (

      <div className="App">


        <div className="box">
        <div class="verticalLine"></div>

        </div>  

        <div className="notification-bar">
        <a className="logo" href>anthologist</a>
        </div>


        



      </div>


    ); 




  }
}

export default App;
